import BendingMachine from '../BendingMachine/index';

const BendingMachine4 = ({ f7router }) => {
  return (
    <BendingMachine bendingNumber={'C007'} tableName={'折弯机工位4'} f7router={f7router}/>
  );
};

export default BendingMachine4;
